// ==UserScript==
// @name    自助取数平台优化助手
// @name:zh   自助取数平台优化助手
// @description 1.数据编码一键翻译为中文  2.自动显示侧边栏 3.一键添加菜单
// @icon    https://ae01.alicdn.com/kf/Hac1a58055c5047cdb91349e91aa208d5k.jpg
// @namespace    http://tampermonkey.net/
// @version      4.0
// @author       Coralfox
// @note    2024.05.24-V1.0 完成数据编码的中文翻译功能
// @note    2024.05.26-V2.0 完成自动显示侧边栏功能
// @note    2024.05.30-V3.0 完成一键添加菜单功能
// @note    2024.06.11-V4.0 增加隐藏界面功能
// @require      https://cdn.bootcdn.net/ajax/libs/crypto-js/4.2.0/crypto-js.min.js
// @match        *://10.177.71.114:8443/*
// @grant           GM_registerMenuCommand
// @grant           gm_localStorage
// @license MIT
// @downloadURL https://update.greasyfork.org/scripts/496525/%E8%87%AA%E5%8A%A9%E5%8F%96%E6%95%B0%E5%B9%B3%E5%8F%B0%E4%BC%98%E5%8C%96%E5%8A%A9%E6%89%8B.user.js
// @updateURL https://update.greasyfork.org/scripts/496525/%E8%87%AA%E5%8A%A9%E5%8F%96%E6%95%B0%E5%B9%B3%E5%8F%B0%E4%BC%98%E5%8C%96%E5%8A%A9%E6%89%8B.meta.js
// ==/UserScript==

(function () {
  ("use strict");

  // 这是你在本地加密后的字典，复制到脚本中
  var encryptedDictionary =
    "";

  // 使用相同的密钥进行解密
  var bytes = CryptoJS.AES.decrypt(encryptedDictionary, "unicom-5g");
  var originalText = bytes.toString(CryptoJS.enc.Utf8);

  // 将解密后的字符串转换回字典
  var dictionary = JSON.parse(originalText);

  // 创建浮动界面
  var floatingDiv = document.createElement("div");

  // 设置 floatingDiv 的样式
  floatingDiv.className = "floatingDiv";
  floatingDiv.style.background = "#111845a6";
  floatingDiv.style.display = "flex";
  floatingDiv.style.justifyContent = "center";
  floatingDiv.style.alignItems = "center"; // 添加这行使内容垂直居中
  floatingDiv.style.flexDirection = "column"; // 添加这行使内容垂直排列
  floatingDiv.style.boxSizing = "border-box";
  floatingDiv.style.position = "fixed";
  floatingDiv.style.bottom = "0px";
  floatingDiv.style.right = "0px";
  floatingDiv.style.zIndex = "9999";
  floatingDiv.style.overflow = "hidden";
  floatingDiv.style.boxShadow = "0 10px 30px rgb(23, 32, 90)";
  floatingDiv.style.border = "2px solid #2a3cad";
  floatingDiv.style.color = "white";
  floatingDiv.style.padding = "10px";

  // 创建一个变量，用于存储当前的显示状态
  var isShow = true; // 初始状态为显示

  // 创建一个新的 div，将按钮和勾选项添加到这个 div 中
  var contentDiv = document.createElement("div");
  contentDiv.style.display = "flex";
  contentDiv.style.flexDirection = "column";
  contentDiv.style.alignItems = "center";

  // 创建自动翻译按钮
  var zh_btn = document.createElement("button");
  zh_btn.textContent = "自动翻译(F2)";
  zh_btn.onclick = executeFunction;
  zh_btn.style.background = "#5F70DC";
  zh_btn.style.color = "white";
  zh_btn.style.border = "none";
  zh_btn.style.padding = "5px 10px";
  zh_btn.style.cursor = "pointer";
  zh_btn.style.marginBottom = "10px";

  // 创建一键添加按钮
  var add_btn = document.createElement("button");
  add_btn.textContent = "一键添加(F3)";
  add_btn.onclick = oneKeyAdd;
  add_btn.style.background = "#5F70DC";
  add_btn.style.color = "white";
  add_btn.style.border = "none";
  add_btn.style.padding = "5px 10px";
  add_btn.style.cursor = "pointer";
  add_btn.style.marginBottom = "10px";

  // 创建勾选项
  var expand_cbx = document.createElement("input");
  expand_cbx.type = "checkbox";
  expand_cbx.id = "expandSidebarCheckbox";
  expand_cbx.onchange = function () {
    if (expand_cbx.checked) {
      // 如果勾选了，就在页面加载时执行函数
      window.onload = Expand_sidebar();
    } else {
      // 如果没有勾选，就在页面加载时不执行函数
      window.onload = null;
    }
  };

  // 创建 label
  var expand_label = document.createElement("label");
  expand_label.htmlFor = "expandSidebarCheckbox";
  expand_label.textContent = "自动显示侧边栏";
  expand_label.style.fontSize = "14px";

  // 创建一个按钮，用于隐藏浮动界面
  var hideButton = document.createElement("button");
  hideButton.textContent = "隐藏界面";
  // hideButton.style.fontSize = "14px";
  hideButton.style.background = "#5F70DC";
  hideButton.style.color = "white";
  hideButton.style.padding = "5px 10px";
  hideButton.style.border = "none";
  hideButton.style.cursor = "pointer";
  hideButton.style.marginBottom = "10px";

  hideButton.onclick = function () {
    if (isShow) {
      // 隐藏 floatingDiv
      document.querySelector(".floatingDiv").style.display = "none";

      // 可以添加更多样式来美化悬浮按钮的外观
    }
    // 切换状态
    isShow = !isShow;
  };

  // 创建一个新的 expand_div 元素
  var expand_div = document.createElement("div");

  // 将 expand_cbx 和 expand_label 添加到 expand_div
  expand_div.appendChild(expand_cbx);
  expand_div.appendChild(expand_label);

  // 将按钮和勾选项加入到 contentDiv
  contentDiv.appendChild(zh_btn);
  contentDiv.appendChild(add_btn);
  contentDiv.appendChild(hideButton);
  contentDiv.appendChild(expand_div);

  // 将 contentDiv 加入到浮动界面
  floatingDiv.appendChild(contentDiv);

  // 将浮动界面加入到页面
  document.body.appendChild(floatingDiv);

  // 添加键盘事件监听器
  document.addEventListener("keydown", function (event) {
    // 检查是否按下了F2键
    if (event.key === "F2") {
      // 阻止默认行为
      event.preventDefault();

      // 触发按钮的点击事件
      zh_btn.click();
    } else if (event.key === "F3") {
      // 阻止默认行为
      event.preventDefault();

      // 触发按钮的点击事件
      add_btn.click();
    }
  });

  // 获取复选框
  let auto_expand_chb = document.getElementById("expandSidebarCheckbox");

  // 检查本地存储中是否有复选框的状态
  if (localStorage.getItem("auto_expand_state") !== null) {
    // 如果有，设置复选框的状态
    auto_expand_chb.checked =
      localStorage.getItem("auto_expand_state") === "true";
  }

  // 当复选框的状态改变时，保存到本地存储
  auto_expand_chb.addEventListener("change", function () {
    localStorage.setItem("auto_expand_state", this.checked);
  });

  // 初始化数组
  var rows_isread = [];

  //根据xpath获取行数
  function getTableRowCountByXPath(xpath) {
    let result = document.evaluate(
      "count(" + xpath + ")",
      document,
      null,
      XPathResult.ANY_TYPE,
      null
    );
    let rowCount = result.numberValue;
    return rowCount;
  }

  // 滚动到指定元素
  function scrollToElement(style, rowNumber) {
    var xpath =
      "//div[contains(@class,'" +
      style +
      "')]//table/tbody/tr[" +
      rowNumber +
      "]/td[3]";
    var element = document.evaluate(
      xpath,
      document,
      null,
      XPathResult.FIRST_ORDERED_NODE_TYPE,
      null
    ).singleNodeValue;

    if (element) {
      element.scrollIntoView();
    }
  }

  // 获取指定 XPath 地址处的文本
  function getTextByXPath(style, rowNumber) {
    var xpath =
      "//div[contains(@class,'" +
      style +
      "')]//table/tbody/tr[" +
      rowNumber +
      "]/td[3]";
    var result = document.evaluate(
      xpath,
      document,
      null,
      XPathResult.STRING_TYPE,
      null
    );
    return result.stringValue.trim();
  }

  // 获取指定 XPath 地址处的行数
  function getRowsByXPath(style) {
    var xpath = "//div[contains(@class,'" + style + "')]//span[@class='title']";
    var result = document.evaluate(
      xpath,
      document,
      null,
      XPathResult.STRING_TYPE,
      null
    );
    var str = result.stringValue.trim();
    var matches = str.match(/\d+/g);

    return matches ? parseInt(matches[0]) : 0;
  }

  // 在指定 XPath 地址处填写文本
  function fillTextByXPath(style, rowNumber, text) {
    var xpath =
      "//div[contains(@class,'" +
      style +
      "')]//table/tbody/tr[" +
      rowNumber +
      "]/td[2]/div/div/input";

    var result = document.evaluate(
      xpath,
      document,
      null,
      XPathResult.FIRST_ORDERED_NODE_TYPE,
      null
    );
    var element = result.singleNodeValue;

    if (element) {
      // 修改元素的值
      element.value = text;

      // 模拟输入事件
      let inputEvent = new Event("input", {
        bubbles: true,
        cancelable: true,
      });
      element.dispatchEvent(inputEvent);

      // 模拟改变事件
      let changeEvent = new Event("change", {
        bubbles: true,
        cancelable: true,
      });
      element.dispatchEvent(changeEvent);

      // 使元素失去焦点
      element.blur();
    }
  }

  // 显示侧边栏
  function Expand_sidebar() {
    var xpath =
      '//*[@id="app"]/div/div[1]/ul[contains(@class,"el-menu--collapse")]/li';

    var result = document.evaluate(
      xpath,
      document,
      null,
      XPathResult.FIRST_ORDERED_NODE_TYPE,
      null
    );
    var element = result.singleNodeValue;

    if (element) {
      // 模拟点击事件
      let event = new Event("click", {
        bubbles: true,
        cancelable: true,
      });
      element.dispatchEvent(event);
    }
  }

  // 执行函数
  function executeFunction() {
    var t_style = ["primary-style", "success-style"];

    // 对于 t_style 数组中的每个元素，获取行数
    t_style.forEach(function (style) {
      //获取区域总行数
      var max_num = getRowsByXPath(style);

      // for (var j = 1; j < max_num; j++) {
      var rows = getTableRowCountByXPath(
        "//div[contains(@class,'" + style + "')]//table/tbody/tr"
      );
      // 遍历每一行
      for (var i = 1; i <= rows; i++) {
        // 获取文本
        var text = getTextByXPath(style, i);

        // 如果文本已经读取过，跳过
        if (rows_isread.includes(text)) {
          continue;
        } else {
          // 在本地词典中查询
          var value = dictionary[text];

          // 填写中文翻译
          if (value) {
            fillTextByXPath(style, i, value);
          }

          // 将文本添加到已读取数组
          rows_isread.push(text);
        }
      }

      // 如果总行数大于当前行数，滚动到目前行
      if (max_num > rows) {
        // 滚动到目前行
        scrollToElement(style, rows);
      }
    });
  }

  // 一键添加
  function oneKeyAdd() {
    // 获取源元素和目标元素
    var expand_bth = document.evaluate(
      "//div[contains(@class,'operate')]//i[contains(@class,'el-tooltip')]",
      document,
      null,
      XPathResult.FIRST_ORDERED_NODE_TYPE,
      null
    ).singleNodeValue;

    if (expand_bth) {
      let expand_event = new Event("click", {
        bubbles: true,
        cancelable: true,
      });
      expand_bth.dispatchEvent(expand_event);
      setTimeout(function () {
        expand_bth.dispatchEvent(expand_event);
      }, 200); // 延迟 5000 毫秒（5 秒）执行 //点击两次显示按钮
    }
    setTimeout(function () {
      var result = document.evaluate(
        "//div[@role='treeitem']//div[contains(@class,'node-content move')]//li[@class='el-dropdown-menu__item'][2]",
        document,
        null,
        XPathResult.ORDERED_NODE_ITERATOR_TYPE,
        null
      );

      var source = result.iterateNext();
      while (source) {
        // 模拟点击事件
        let event = new Event("click", {
          bubbles: true,
          cancelable: true,
        });
        source.dispatchEvent(event);

        source = result.iterateNext();
      }
    }, 1500); // 延迟 5000 毫秒（5 秒）执行
  }

  window.addEventListener("load", function () {
    // 获取复选框的状态
    var checkboxState = localStorage.getItem("auto_expand_state");

    // 如果状态为'true'，设置一个 MutationObserver
    if (checkboxState === "true") {
      // 创建一个观察器实例
      var observer = new MutationObserver(function (mutations) {
        // 检查每一个 mutation
        mutations.forEach(function (mutation) {
          // 遍历所有添加的节点
          for (var i = 0; i < mutation.addedNodes.length; i++) {
            var node = document.querySelector(
              "#app > div > div.sidebar-panel.sidebar-container.has-logo > ul > li > i"
            );

            if (node) {
              console.log("已经自动打开侧边栏");
              Expand_sidebar();
              // 停止观察
              observer.disconnect();
              // 退出循环
              break;
            }
          }
        });
      });

      // 配置观察器：观察子节点和后代的变化
      var config = { childList: true, subtree: true };

      // 传入目标节点和观察选项
      observer.observe(document.body, config);
    }
  });

  // 在油猴菜单中添加“显示界面”选项
  GM_registerMenuCommand("显示界面", function () {
    //点击后显示floatingDiv
    document.querySelector(".floatingDiv").style.display = "block"; // 或者使用其他显示方式，如'flex'
    // 切换状态
    isShow = !isShow;
  });
})();
